import React from "react";

import H from './Picture/home.png';
import V from './Picture/video.png';
import Ma from './Picture/store.png';
import P from './Picture/people.png';
import G from './Picture/games.png';
import './Navbar.css';

function Nav() {
    return (
      <div className="Navbar">
        <div className="L">
                <p>Lift</p>
        </div>
        <div className="M">
        
       <button> <img src={H} className="App-logo" alt="Home" /></button>
        <img src={V} className="App-logo" alt="Video" />
        <img src={Ma} className="App-logo" alt="Market" />
        <img src={P} className="App-logo" alt="People" />
        <img src={G} className="App-logo" alt="Game" />
        </div>
        <div className="R">
            <p>Right</p>
        </div>
      </div>
    );
  }
  
  export default Nav;
